    //funciones

    function addList (title, price){
        console.log(title,price);
        listaProductos.innerHTML+=`
            <li class="list-group-item d-flex justify-content-between align-items-center" onclick="
            this.parentNode.removeChild(this);
            count--;
            countSpan.innerHTML=count;
            t-=parseFloat(${price});
            total.innerHTML='$ ${price}.0';
            ">
                ${title}
                <span class="badge bg-primary rounded-pill">$ ${price}  </span>
                <button type="button" class="btn bg-danger text-white">x</button>
            </li>
        `;
        count++;
        countSpan.innerHTML=count;
        t+=parseFloat(price);
        total.innerHTML= ` $ ${t}.0`;
    }

    let containerCard= document.getElementById('containerCard');
    function getCards() {
        for (let i = 0; i <=products.length ; i++) {
            containerCard.innerHTML+=`
                <div class="container-fluid d-flex justify-content-around col-4 mb-4" id="card4">
                    <div class="card">
                        <img src="${products[i].imgUrl}" class="card-img-top" alt="150px" >
                        <div class="card-body">
                            <h5 class="card-title">${products[i].title}</h5>
                            <p class="card-text">${products[i].description}</p>
                            <p class="card-text">Precio $ ${products[i].price}</p>
                             <a class="btn btn-success" onclick="addList('${products[i].title}',' ${products[i].price.toString()}')">agregar al carrito.</a>
                        </div>
                    </div>
                </div>
                `;


        }
    }

    getCards();
